import'./Navbar.css'

function Navbar() {
  return (
    <nav id='navbar'>
      <i className='burger-btn' />
      <ul className='list-opacity-animation'>
        <li>About Me</li>
        <li>Experience</li>
        <li>Portfolio</li>
        <li>Contact</li>
      </ul>
  </nav>
  );
}

export default Navbar;
